# IIFE (即時実行関数式)

IIFE (Immediately Invoked Function Expression; 即時実行関数式) は定義されるとすぐに実行される

```js
(function () {
    文
})();
```
このデザインパターンは自己実行無名関数とも呼ばれ、次の2つの主な部分から成ります。

* 最初の部分は グループ化演算子 () に囲まれた静的スコープ付きの無名関数です。これは IIFE イディオム内で、汚いグローバルスコープと同様に変数へアクセスすることを防ぎます。
* 2つ目の部分は即時実行関数式の () で、これを通じて JavaScript エンジンは直接関数を解釈実行します。

```js
(function () {
    var aName = "Barry";
})();
// 変数 aName はスコープ外からアクセスできません
aName // "Uncaught ReferenceError: aName is not defined" が発生します

```
IIFE を変数に代入することはその結果だけが保存されます。
```js
var result = (function () {
    var name = "Barry";
    return name;
})();
// Immediately creates the output:
result; // "Barry"

```

```js
var result = (function(){
    "use strict";
    /* コードの開始 */
    console.log("11");
    //メソッドの内部メソッドは外部でアクセスできない
    function greetMe(yourName) {
      console.log('Hello ' + yourName);
    }

    greetMe('World');
    /* コードの終了 */
  })();
console.log("22");
console.log(result);
/******** ouput*********/
11
Hello World
22
undefined
```
