# 宣言

JavaScript には変数を宣言する方法が 3種類あります。

* var 変数を宣言し、ある値に初期化することもできる。
* let ブロックスコープのローカル変数を宣言し、ある値に初期化することもできる。
* const ブロックスコープで読み取り専用の名前付き定数を宣言する。

## letとconst分別
* letは初期化がいらない。const初期化が必要です。
* letは変更できる。constは変更できない。

