## 分割代入
({}={})使う時に、前の;よく使う方がいいです。
```js
//分割代入

let a, b, rest;
[a, b] = [10, 20];
console.log(a); // 10
console.log(b); // 20

[a, b, ...rest] = [10, 20, 30, 40, 50];
console.log(a); // 10
console.log(b); // 20
console.log(rest); // [30, 40, 50]

({ a, b } = { a: 10, b: 20 });
console.log(a); // 10
console.log(b); // 20


// Stage 4(finished) proposal 
({a, b, ...rest} = {a: 10, b: 20, c: 30, d: 40});
