console.log(b); // 20
console.log(rest); // {c: 30, d: 40}

// 複数対複数
const x = [1, 2, 3, 4, 5];
const [y, z] = x;
console.log(y); // 1
console.log(z); // 2

//
let [x,y] = [5]
console.log(x); //5
console.log(y); //undfined

```


