# yied

```js
let a = function* (){
    yield 2;
    yield 1;
    yield 3;
}
let x = a()
console.log(a); //[GeneratorFunction: a]
console.log(x); //Object [Generator] {}
console.log(x.next().value); //2
console.log(x.next().value);//1
console.log(x.next().value);//3
console.log(x.next().value);//undefined

console.log(a().next().value);//2
console.log(a().next().value);//2
console.log(a().next().value);//2

function* foo(index) {
    while (index < 2) {
      yield index;
      index++;
    }
  }

  const iterator = foo(0);

  console.log(iterator.next().value);
  // expected output: 0

  console.log(iterator.next().value);
  // expected output: 1


```

