## Symbol

ユニークなものです。

### 名前の競合が発生する例解決
```js
// A.js
/**
ビルトインオブジェクトである Object を拡張して、
自身の name プロパティを返すメソッドを追加
*/
Object.prototype.getName = function () {
  return this.name;
};

// B.js
/**
ビルトインオブジェクトである Object を拡張して、
hanako という名前を返すメソッドを追加
*/
Object.prototype.getName = function () {
  return 'hanako';
};

// index.js
import './A.js';
import './B.js';

console.log({name: 'taro'}.getName()); // hanako

```

```js
//A.js
const sym = Symbol();

//作成したシンボルをキーにしたメソッドを定義する
Object.prototype[sym] = function () {
  return this.name;
};

//シンボルをモジュールの外から参照できるようにエクスポートする
export {sym as default};

//B.js
const sym = Symbol();

//作成したシンボルをキーにしたメソッドを定義する
Object.prototype[sym] = function () {
  return 'hanako';
};

//シンボルをモジュールの外から参照できるようにエクスポートする
export {sym as default};

// index.js
import symA from './A.js';
import symB from './B.js';

//変数 symA と symB の値は決して競合しないので、
//安全に目的のメソッドを実行できる
console.log({name: 'taro'}[symA]());

```

### Symbol.for()
```js
console.log(Symbol.for('bar') === Symbol.for('bar'));
// expected output: true

console.log(Symbol('bar') === Symbol('bar'));
// expected output: false

const symbol1 = Symbol.for('foo');

console.log(symbol1.toString());
// expected output: "Symbol(foo)"

```
